function Projects({ projects }) {
  return (
    <div className="projects-grid">
      {projects.map((p, i) => (
        <div key={i} className="project-card">
          <img src={p.img} alt={p.title} />
          <h3>{p.title}</h3>
          <p>{p.desc}</p>
          <div className="mt-2">
            {/* opens the HTML page as a new tab */}
            <a
              href={p.link}
              target="_blank"
              rel="noopener noreferrer"
              className="underline"
            >
              View Live Demo
            </a>
            {p.video && (
              <a
                href={p.video}
                target="_blank"
                rel="noopener noreferrer"
                className="ml-4 underline"
              >
                Watch Video
              </a>
            )}
          </div>
        </div>
      ))}
    </div>
  );
}


const projects = [
  {
    title: "UYY BINALOT",
    desc: "A POS system designed for restaurants...",
    img: binalotImg,
    link: "/projects/Binalots/Binalots/home.html",
  },

];
